import "./Header.css";

const Header = () => {
  const funds = "273.749";

  return (
    <div className="top container row">
      <div className="">
        <div className="">
          <div className="col-sm-12 col-md-3 topInfo">
            <h3>
              Money: <span>Kr. {funds},-</span>
            </h3>
          </div>
          <div classname="col-sm-12 col-md-3 topInfo">
            <h3>
              Next Plan: <span>3 days left</span>
            </h3>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Header;
